  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130770 includes physical
  and profile data collected aboard the NAVIGATION RESPONSE TEAM 5 during project
  OPR-A375-NRT5-10 in the Bay of Fundy from 2010-06-10 to 2010-10-26. These data include
  CONDUCTIVITY, HYDROSTATIC PRESSURE, SALINITY, SOUND VELOCITY, WATER DENSITY and
  WATER TEMPERATURE. The instruments used to collect these data include CTD and sound
  velocimeter. These data were collected and submitted by the NOAA Office of Coast
  Survey in support of hydrographic multibeam surveys to meet NOAA charting requirements.\",\n\t\"owner_org\":
